import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product card (using .product-card)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Find all product cards
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      throw new Error('No product cards found');
    }

    // Within the first product card, find the "Add to Cart" button
    const firstProductCard = productCards[0];
    const addToCartBtn = await firstProductCard.$('button.add-to-cart');
    if (!addToCartBtn) {
      throw new Error('Add to Cart button not found in first product card');
    }

    // Click the "Add to Cart" button
    await addToCartBtn.click();

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add_to_cart.png'));

    // Extract cart count from the cart counter element (id="cartCount")
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCountText = await page.$eval('#cartCount', el => el.textContent.trim());

    // Extract the notification message
    const notificationText = await page.$eval('.notification.success', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product to cart and verified cart count and notification",
      extractedData: {
        cartCount: cartCountText,
        notification: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
